import React, { Component } from "react";
import { Text, View, TextInput, KeyboardAvoidingView, TouchableOpacity } from "react-native";
import container from "../../Styles/Container/style";
import Color from "../../Config/Color";
import Button from "../../Component/Button/index";
export default class signIn extends Component {

  constructor(props) {
    super(props);

    this.state = {
      mobile: "",
      password: ""
    }
  }

  render() {
    return (
      <KeyboardAvoidingView>
        <View style={{ marginVertical: 20, marginHorizontal: 15, }}>
          <TextInput
            style={{
              borderColor: Color.steel,
              borderWidth: 0.5,
              borderRadius: 5,
              fontSize: 18,
              marginVertical: 10,
              paddingHorizontal: 15,
              paddingVertical: 7,
              fontFamily: 'uber-r',
            }}
            placeholderTextColor={Color.steel}
            placeholder="Mobile number"
            underlineColorAndroid={"transparent"}
            keyboardType="phone-pad"
            autoCapitalize='none'
            onChangeText={(val) => this.setState({ mobile: val })}
          />
          <TextInput
            style={{
              borderColor: Color.steel,
              borderWidth: 0.5,
              borderRadius: 5,
              fontSize: 18,
              marginVertical: 10,
              paddingHorizontal: 15,
              paddingVertical: 7,
              fontFamily: 'uber-r',
            }}
            autoFocus={true}
            secureTextEntry={true}
            placeholderTextColor={Color.steel}
            placeholder="xxxxxxxxxxxx"
            underlineColorAndroid={"transparent"}
            autoCapitalize='none'
            onChangeText={(val) => this.setState({ password: val })} />
        </View>

        <Button Text="Next" textStyle={{ fontSize: 15 }} onPress={() => this.props.submitHandler(this.state.mobile, this.state.password)} />

      </KeyboardAvoidingView>
    );
  }
}
